webpackJsonp([0x81b8806e4260],{518:function(t,e){t.exports={pathContext:{group:[{node:{fields:{slug:"/56-solid-book/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/655630586&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Порекомендую книгу о знаменитых SOLID принципах ООП с примерами на TypeScript: <a href="https://ota-solid.now.sh">https://ota-solid.now.sh</a></p>\n<p>Книга написала приятным и понятным языком, совсем не большая - я не напрягаясь прочитал за выходные. Помимо описания самих SOLID принципов, по каждому из них даются как идеальные примеры, так и примеры из реальной жизни, а также описаны антипаттерны, “запахи кода”, ограничения и подводные камни.</p>\n<p>Книга интерактивная, по мере чтения нужно будет отвечать на вопросы по только что пройденному материалу - эти мини-тесты очень хорошо помогают закрепить материал. Авторы Саша Беспоясов и Артём Самофалов проделали большой труд и хорошо поработали над материалом, чтобы сделать его доступным и полезным для читателей разного уровня подготовки!</p>\n<p>Исходники книги доступны на GitHub, поддержать проект можно на Patreon.</p>\n<ul>\n<li><a href="https://ota-solid.now.sh">https://ota-solid.now.sh</a></li>\n<li><a href="https://github.com/open-tech-authors">https://github.com/open-tech-authors</a></li>\n<li><a href="https://www.patreon.com/open_tech_authors">https://www.patreon.com/open<em>tech</em>authors</a></li>\n</ul>',excerpt:"Порекомендую книгу о знаменитых SOLID принципах ООП с примерами на TypeScript:  https://ota-solid.now.sh Книга написала приятным и понятным…",frontmatter:{title:"SOLID с примерами на TypeScript",date:"July 24, 2019",featuredImage:null}}},{node:{fields:{slug:"/55-gitlab-salary/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/648023975&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Компания GitLab с каждым годом набирает обороты. Как ни странно для OpenSource проекта, из него получился не плохой бизнес! Что интересно, в GitLab все внутренние процессы максимально открыты и описаны в публичном Handbook, включая вилки зарплат, принцип их построения и даже интерактивный калькулятор. Воспользуемся этим калькулятором, чтобы примерить зарплату фронтенд-разработчика в GitLab на себя.</p>\n<ul>\n<li><a href="https://about.gitlab.com/handbook/">https://about.gitlab.com/handbook/</a></li>\n<li><a href="https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/">https://about.gitlab.com/handbook/people-operations/global-compensation/calculator/</a> - зарплатный калькулятор в GitLab</li>\n<li><a href="https://soundcloud.com/frontend-weekend/fw-94">https://soundcloud.com/frontend-weekend/fw-94</a> - Денис Мишунов в подкасте Frontend Weekend.</li>\n<li><a href="https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g">https://www.youtube.com/channel/UCW9pyonagDWGMCy7V_Kro6g</a> - JavaScript.Ninja от Ильи Климова</li>\n</ul>',excerpt:"Компания GitLab с каждым годом набирает обороты. Как ни странно для OpenSource проекта, из него получился не плохой бизнес! Что интересно, в…",frontmatter:{title:"Зарплаты в GitLab",date:"July 8, 2019",featuredImage:null}}},{node:{fields:{slug:"/54-youtube-screencasts/"},html:'<iframe width="100%" height="166" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/641013810&color=%23ff5500&auto_play=false&hide_related=true&show_comments=true&show_user=true&show_reposts=false&show_teaser=true"></iframe>\n<p>Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал.</p>\n<p>Но только этом году я попробовал записывать полноценные скринкасты: видео где показывается реализация какого-то алгоритма на JavaScript. Выбрал не самые простые темы, но интересные (по крайней мере мне). </p>\n<p>Что самое главное, постарался рассказать подробно и понятно, разбивая задачу на отдельные шаги, комментируя принимаемые решения, отвечая на собственные вопросы по ходу. Мне кажется, получилось не плохо, буду продолжать ещё.</p>\n<p>Подписывайтесь: <a href="https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw">https://www.youtube.com/channel/UCtcMCp5GwNdQuloP4v5slfw</a></p>',excerpt:"Сегодня у меня небольшое объявление: у подкаста уже давно есть одноимённый YouTube канал. Но только этом году я попробовал записывать…",frontmatter:{title:"Скринасты Пятиминутки React на YouTube",date:"June 23, 2019",featuredImage:null}}},{node:{fields:{slug:"/screeencast_async_await_to_generators/"},html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <iframe src="https://www.youtube.com/embed/czgxE_UQnDQ" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<p>В этом скринкасте я хочу повнимательнее посмотреть на работу async/await.\nПопробуем вручную транспилировать async/await в генераторы, посмотрим как это делают Babel и TypeScript.</p>\n<p><a href="https://bit.ly/2L0RtMf">https://bit.ly/2L0RtMf</a> - TypeScript Playground\n<a href="https://bit.ly/2RmELsu">https://bit.ly/2RmELsu</a> - Babel Playground</p>',excerpt:"В этом скринкасте я хочу повнимательнее посмотреть на работу async/await.\nПопробуем вручную транспилировать async/await в генераторы…",frontmatter:{title:"Траспиляция из async/await в генераторы",date:"June 18, 2019",featuredImage:null}}},{node:{fields:{slug:"/screeencast_for_loops_are_complicated/"},html:'<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.25%; position: relative; height: 0; overflow: hidden;margin-bottom: 1.0725rem"\n          >\n            <iframe src="https://www.youtube.com/embed/gAPh2W8qcUY" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          "></iframe>\n          </div>\n          </div>\n<p>На днях я смотрел занятное видео с погружением в цикл for: <a href="https://youtu.be/Nzokr6Boeaw">https://youtu.be/Nzokr6Boeaw</a></p>\n<p>Оно побудило записать меня этот скринкаст, чтобы своими словами раскрыт тему областей видимости переменных при использовании циклов.</p>',excerpt:"На днях я смотрел занятное видео с погружением в цикл for:  https://youtu.be/Nzokr6Boeaw Оно побудило записать меня этот скринкаст, чтобы…",frontmatter:{title:"JavaScript for-loops are… complicated",date:"June 17, 2019",featuredImage:null}}}],pathPrefix:"",first:!0,last:!1,index:1,pageCount:12,additionalContext:{}}}}});
